import React from 'react';
import { Drawer, List, ListItem, ListItemText, Toolbar, AppBar, Typography, CssBaseline } from '@mui/material';
import { Link } from 'react-router-dom';

const drawerWidth = 240;

const Sidebar = () => {
  return (
    <div>
      <CssBaseline />
      <AppBar position="fixed" sx={{ width: `calc(100% - ${drawerWidth}px)`, ml: `${drawerWidth}px` }}>
        <Toolbar>
          <Typography variant="h6" noWrap component="div">
            Healthcare Triage System
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
          },
        }}
      >
        <Toolbar />
        <div style={{ width: drawerWidth }}>
          <List>
            <ListItem button component={Link} to="/">
              <ListItemText primary="Dashboard" />
            </ListItem>
            <ListItem button component={Link} to="/task-queue">
              <ListItemText primary="Task Queue" />
            </ListItem>
            <ListItem button component={Link} to="/patients">
              <ListItemText primary="Patients" />
            </ListItem>
            <ListItem button component={Link} to="/completed-tasks">
              <ListItemText primary="Completed Tasks" />
            </ListItem>
            <ListItem button component={Link} to="/add-patient">
              <ListItemText primary="Add Patient" />
            </ListItem>
          </List>
        </div>
      </Drawer>
    </div>
  );
};

export default Sidebar;
